import {StateContext} from './stateContext';
import Details from '../component/details';

export default function Home(){
    const [items, setItems] = useContext(StateContext);

    
    return (
        <div>
            <h1>Home Page</h1>
            {items.map(item => (
                <div>{item.value}</div>
            ))}
        </div>
    );
}
